import React, { useState } from "react";

const App = () => {
  const [num1, setNum1] = useState(0);
  const [num2, setNum2] = useState();
  return (
    <div id="main">
      <input id="input1" onChange={(e) => setNum1(parseInt(e.target.value))} />
      +
      <input id="input2" onChange={(e) => setNum2(parseInt(e.target.value))} />
      <p id="result">{num1 + num2}</p>
    </div>
  );
};

export default App;
